import React, { Component } from 'react';

export default class CalculationsList extends Component {
    constructor(props) {
        super(props);

        this.state = {
            operand1: '',
            operand2: '',
            operator: '',
            calculations: []
        }
    }

    onChangeOperand1(e) {
        this.setState({
            operand1: e.target.value
        });
    }

    onChangeOperand2(e) {
        this.setState({
            operand2: e.target.value
        });
    }
    onChangeOperator(e) {
        this.setState({
            operator: e.target.value
        });
    }

    onSubmit(e){
        e.preventDefault();

        const calculation = {
            operand1 : this.state.operand1,
            operand2 : this.state.operand2,
            operator : this.state.operator

        }
    }

    render() {
        return (
            <div>
                <p>Welcome to calculations page!!</p>
            </div>
        )
    }
}
